import React from "react";
import "./Login.css";

function Login() {
  return (
    <div className="login-page">
      <img
        className="header_logo"
        src="https://bizmonthly.com/wp-content/uploads/2020/04/Amazon-logo-black-template.png"
      />
    </div>
  );
}

export default Login;
